import {Route}from'react-router-dom'

import AllMeetupsPage from './pages/AllMeetups';
import FavoritesPage from './pages/Favorites';
import NewMeetupsPage from './pages/NewMeetup';

function App() {
  return( 
  <div>
    <Route path='/'>
      <AllMeetupsPage/>
     </Route>
    <Route path='/'>
      <FavoritesPage/>
    </Route>
    <Route path='/'>
      <AllMeetupsPage/>
      <FavoritesPage/>
      <NewMeetupsPage/>
    </Route>
  </div>);
}

export default App;
